import { Box, FormControl, styled } from "@mui/material";

const Container = styled('Box')`
margin : 50px 100px;
`


const CreatePost = () => {

  const url = "/project_picture/altumcode-dMUt0X3f59Q-unsplash.jpg";
    return (
      <Container>
        <Image
          src={url}
          alt="Banner"
        />
        <FormControl>
          <label htmlFor="FileInput">
            Input
          </label>
          <input type="file" name="" id="" />
        </FormControl>
      </Container>
    );
};

export default CreatePost;
